import { Box, Chip } from "@mui/material";
import axios from "axios"
import { useEffect, useState } from "react"

const PokeCard = ({data}) => {

    const [currentPokemon, setCurrentPokemon] = useState()

    useEffect(() => {
        axios
            .get(data[0].url)
            .then(res => setCurrentPokemon(res.data))
    }, [data]);

    return (
        <Box sx={{
            width: 980, 
            height: 500,
            display: 'flex',
        }}>
            <Box sx={{
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'start',
                flexWrap: 'wrap',
                gap: 3
            }}>
                {
                    data.map(pokemon => {
                        let name = pokemon.name;
                        return (
                            <Chip label={name}/>
                        )
                    })
                }
            </Box>
            <Box sx={{
                width: 484,
                bgcolor: '#000000',
            }}>
                {
                    currentPokemon && 
                    <div>
                        Hello {currentPokemon.name}!
                    </div>
                }
            </Box>


        </Box>
    )
} 

export default PokeCard
